const Form = () =>{
  return (
     <div className="form-contenedor">
      <form className="form">
        <label className="label1">Email:</label>
            <input
            type ="text"
            name = "email" />
        
        <label className="label2">Password:</label>
            <input
            type= "text"
            name = "password" />
        
        <button className="btn-submit">Submit</button>
      </form>
    </div>
  )
}

export default Form;
